selector_to_html = {"a[href=\"#c1qtnf3-mesenchyme\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">C1qtnf3+ Mesenchyme<a class=\"headerlink\" href=\"#c1qtnf3-mesenchyme\" title=\"Permalink to this heading\">#</a></h2><p>We identified a cluster that specifically expresses <em>C1qtnf3</em>, aligning with the study <span id=\"id11\">[]</span>.\n<img alt=\"png\" src=\"../_images/C19-3.png\"/></p>", "a[href=\"#osteoblast\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Osteoblast<a class=\"headerlink\" href=\"#osteoblast\" title=\"Permalink to this heading\">#</a></h2><p>We discovered a cell cluster that highly expresses osteogenesis markers, such as <em>Cd200</em> <span id=\"id1\">[]</span>, <em>Alpl</em> <span id=\"id2\">[]</span>, and <em>Ifitm5</em> <span id=\"id3\">[]</span>.\n<img alt=\"png\" src=\"img/annotation/C19-4_marker.png\"/></p>", "a[href=\"#high-mito\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">High-Mito<a class=\"headerlink\" href=\"#high-mito\" title=\"Permalink to this heading\">#</a></h2><p>This cluster of cells highly expresses mitochondrial-related genes, which may be related to <a class=\"reference external\" href=\"https://kb.10xgenomics.com/hc/en-us/articles/360001086611-Why-do-I-see-a-high-level-of-mitochondrial-gene-expression\">technical bias</a>.\n<img alt=\"png\" src=\"../_images/C19-14.png\"/></p>", "a[href=\"#pre-odontoblast\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Pre-odontoblast<a class=\"headerlink\" href=\"#pre-odontoblast\" title=\"Permalink to this heading\">#</a></h2><p>We named this cluster based on the following reasons:</p>", "a[href=\"#coronal-papilla\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Coronal Papilla<a class=\"headerlink\" href=\"#coronal-papilla\" title=\"Permalink to this heading\">#</a></h2><p>We annotated the coronal papilla based on the expression of <em>Lmo</em> <span id=\"id8\">[<a class=\"reference internal\" href=\"../references.html#id2\" title=\"Junjun Jing, Jifan Feng, Yuan Yuan, Tingwei Guo, Jie Lei, Fei Pei, Thach-Vu Ho, and Yang Chai. Spatiotemporal single-cell regulatory atlas reveals neural crest lineage diversification and cellular function during tooth morphogenesis. Nature Communications, 13(1):4803, August 2022. doi:10.1038/s41467-022-32490-y.\">Jing <em>et al.</em>, 2022</a>]</span>.\n<img alt=\"png\" src=\"img/annotation/C19_12_marker.png\"/></p>", "a[href=\"#level-3-annotation\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Level 3 Annotation<a class=\"headerlink\" href=\"#level-3-annotation\" title=\"Permalink to this heading\">#</a></h1><h2>Motivation<a class=\"headerlink\" href=\"#motivation\" title=\"Permalink to this heading\">#</a></h2><p>In level 3 annotation, we aim to identify subclusters of mesenchyme cells.\n<img alt=\"png\" src=\"../_images/C19_clusters.png\"/></p>", "a[href=\"#tfap2b-mesenchyme-hic1-mesenchyme-pax3-mesenchyme\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Tfap2b+ Mesenchyme, Hic1+ Mesenchyme, Pax3+ Mesenchyme<a class=\"headerlink\" href=\"#tfap2b-mesenchyme-hic1-mesenchyme-pax3-mesenchyme\" title=\"Permalink to this heading\">#</a></h2><p>These clusters were mainly annotated based on their marker genes.\n<img alt=\"png\" src=\"../_images/C19-mes.png\"/></p>", "a[href=\"#cementoblast\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Cementoblast<a class=\"headerlink\" href=\"#cementoblast\" title=\"Permalink to this heading\">#</a></h2><p>Our atlas also identified cementoblasts, which express <em>Pthlh</em> <span id=\"id4\">[]</span>, <em>Tubb3</em> <span id=\"id5\">[]</span>, <em>Ibsp</em> <span id=\"id6\">[<a class=\"reference internal\" href=\"../references.html#id29\" title=\"Florian Hermans, Celine Bueds, Lara Hemeryck, Ivo Lambrichts, Annelies Bronckaers, and Hugo Vankelecom. Establishment of inclusive single-cell transcriptome atlases from mouse and human tooth as powerful resource for dental research. Frontiers in Cell and Developmental Biology, 2022.\">Hermans <em>et al.</em>, 2022</a>]</span>, and <em>MMp13</em> <span id=\"id7\">[<a class=\"reference internal\" href=\"../references.html#id29\" title=\"Florian Hermans, Celine Bueds, Lara Hemeryck, Ivo Lambrichts, Annelies Bronckaers, and Hugo Vankelecom. Establishment of inclusive single-cell transcriptome atlases from mouse and human tooth as powerful resource for dental research. Frontiers in Cell and Developmental Biology, 2022.\">Hermans <em>et al.</em>, 2022</a>]</span>.\n<img alt=\"png\" src=\"../_images/C19_8_marker.png\"/></p>", "a[href=\"#kit-papilla\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Kit+ Papilla<a class=\"headerlink\" href=\"#kit-papilla\" title=\"Permalink to this heading\">#</a></h2><p>This cluster highly expresses <em>Kit</em> and <em>Pclo</em>, aligning with results from this study <span id=\"id9\">[<a class=\"reference internal\" href=\"../references.html#id30\" title=\"Yingchun Zheng, Ting Lu, Leitao Zhang, Zhongzhi Gan, Aoxi Li, Chuandong He, Fei He, Sha He, Jian Zhang, and Fu Xiong. Single-cell RNA-seq analysis of rat molars reveals cell identity and driver genes associated with dental mesenchymal cell differentiation. BMC Biology, 22(1):1\u201313, September 2024. doi:10.1186/s12915-024-01996-w.\">Zheng <em>et al.</em>, 2024</a>]</span>.\n<img alt=\"png\" src=\"img/annotation/C19_16.png\"/></p>", "a[href=\"#cycling-mesenchyme\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Cycling Mesenchyme<a class=\"headerlink\" href=\"#cycling-mesenchyme\" title=\"Permalink to this heading\">#</a></h2><p>This subcluster of mesenchyme expresses cell cycle-related genes, such as <em>Top2a</em>. It also expresses early mesenchyme marker genes, such as <em>Tfap2b</em> and <em>Lhx6</em> <span id=\"id10\">[<a class=\"reference internal\" href=\"../references.html#id2\" title=\"Junjun Jing, Jifan Feng, Yuan Yuan, Tingwei Guo, Jie Lei, Fei Pei, Thach-Vu Ho, and Yang Chai. Spatiotemporal single-cell regulatory atlas reveals neural crest lineage diversification and cellular function during tooth morphogenesis. Nature Communications, 13(1):4803, August 2022. doi:10.1038/s41467-022-32490-y.\">Jing <em>et al.</em>, 2022</a>]</span>.\n<img alt=\"png\" src=\"img/annotation/C19_7_marker.png\"/></p>", "a[href=\"#low-quality-2\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Low Quality 2<a class=\"headerlink\" href=\"#low-quality-2\" title=\"Permalink to this heading\">#</a></h2><p><img alt=\"png\" src=\"../_images/C19-18.png\"/></p>", "a[href=\"#motivation\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Motivation<a class=\"headerlink\" href=\"#motivation\" title=\"Permalink to this heading\">#</a></h2><p>In level 3 annotation, we aim to identify subclusters of mesenchyme cells.\n<img alt=\"png\" src=\"../_images/C19_clusters.png\"/></p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`div.content ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
